import React, { useState } from "react";

const ContactForm = () =>{
    let [inputValue, setInputValue] =useState({
        name: "",
        email: "",
        subject: "",
        message: ""
    })


    return(
        <form>
            <div className="form_div">
            <input type="text" name="name" placeholder="Your Name*" required className="name" onChange={getValue}/>
            <input type="email" name="email" placeholder="Email Address*" required  className="email" onChange={getValue}/>

            </div>

            <input type="text" name="subject" placeholder="Subject*" required className="subject"/> <br/>
            <textarea type="text" name="message" placeholder="Message*" required  className="message"/> <br/>

            <div className="btn1">
            <button data-aos="zoom-in-up">Send Now <i className="fa-solid fa-paper-plane"></i></button>
            </div>
        </form>

    )
}

export default ContactForm;
